template.declaration:
// Place local declarations here.

key_t password[passwordsize];

clock x;

void initialisePassword () {
    int i = 0;
    for (i= 0; i< passwordsize; i++) {
        password[i] = fint(random (1.0)*INPUTSIZE);
    }
}

int keyval = 0;
int keyindex = -1;
bool signinfailed = false;
bool signinsuccess = false;

void readkey () {
    keyindex = keyindex +1;  
    keyval = fint(random(1.0)*INPUTSIZE);
}

bool correctKey () {
    return keyval == password[keyindex];
}

bool incorrectKey () {
    return keyval != password[keyindex];
}

